import Cheftastic from '../Assets/Chefatstic.png'
import CovidTracker from '../Assets/CovidTracker.png'
import zombaze from '../Assets/zombaze.jpg'
import news from '../Assets/news.png'
import ReactNative from '../Assets/ReactNative.png'
import android from '../Assets/android.png'
import unity from '../Assets/unity.png'
import ux from '../Assets/ux.png'
import dsc from '../Assets/dsc.png'
import AndroidJams from '../Assets/AndroidJams.png'
import FurryCartoon from '../Assets/FurryCartoon.png'
import Couple from '../Assets/lowPolo.png'
import shirley from '../Assets/shirley.png'
import Siddharth from '../Assets/Siddharth.png'
import camela from '../Assets/camela.png'
import snowglobe from '../Assets/snowglobe.png'
import web from '../Assets/web.png'

export const skillsPortfolio = [
    {
        id: 1,
        title: "React Native",
        img: ReactNative
    },
    {
        id: 2,
        title: "Native Android",
        img: android
    },
    {
        id: 3,
        title: "Unity Game Development",
        img: unity
    },
    {
        id: 4,
        title: "UI/UX",
        img: ux
    }
];

export const experiencePortfolio = [
    {
        id: 1,
        title: "Developer Students Club Core Team Member",
        img: dsc
    },
    {
        id: 2,
        title: "Campus Facilitator for Android Study Jams 2021",
        img: AndroidJams
    }
];

export const apps = [
    {
        id: 1,
        title: "Chefatstic",
        img: Cheftastic
    },
    {
        id: 2,
        title: "Covid-19 Tracker",
        img: CovidTracker
    },
    {
        id: 3,
        title: "RSS News Reader",
        img: news
    }
];

export const game = [
    {
        id: 1,
        title: "Zombaze",
        img: zombaze
    }
]

export const graphics = [
    {
        id: 1,
        title: "Snowglobe",
        img: snowglobe
    },
    {
        id: 2,
        title: "Furry Cartoon",
        img: FurryCartoon
    },
    {
        id: 3,
        title: "A Couple",
        img: Couple
    },
    {
        id: 4,
        title: "Vector Portrait",
        img: shirley
    },
    {
        id: 5,
        title: "Vector Portrait",
        img: Siddharth
    },
    {
        id: 6,
        title: "Vector Portrait",
        img: camela
    },
];

export const website = [
    {
        id: 1,
        title: "No Website till now",
        img: web
    }
]
